--
-- Name: log_availability_changes(); Type: FUNCTION; Schema: public; Owner: pnptvbot
--

CREATE FUNCTION public.log_availability_changes() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    change_type VARCHAR(20);
    old_values JSONB;
    new_values JSONB;
BEGIN
    IF TG_OP = 'INSERT' THEN
        change_type := 'created';
        new_values := to_jsonb(NEW);
    ELSIF TG_OP = 'UPDATE' THEN
        change_type := 'updated';
        old_values := to_jsonb(OLD);
        new_values := to_jsonb(NEW);
    ELSIF TG_OP = 'DELETE' THEN
        change_type := 'deleted';
        old_values := to_jsonb(OLD);
    END IF;

    INSERT INTO availability_change_log (
        availability_id,
        model_id,
        changed_by,
        change_type,
        old_values,
        new_values,
        created_at
    ) VALUES (
        COALESCE(NEW.id, OLD.id),
        COALESCE(NEW.model_id, OLD.model_id),
        current_setting('jitsi.app_user'),
        change_type,
        old_values,
        new_values,
        NOW()
    );

    RETURN NULL;
END;
$$;


