--
-- Name: broadcast_engagement_summary; Type: VIEW; Schema: public; Owner: pnptvbot
--

CREATE VIEW public.broadcast_engagement_summary AS
 SELECT broadcast_id,
    count(DISTINCT user_id) AS total_recipients,
    count(
        CASE
            WHEN ((status)::text = 'delivered'::text) THEN 1
            ELSE NULL::integer
        END) AS delivered_count,
    count(
        CASE
            WHEN (message_opened_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END) AS opened_count,
    count(
        CASE
            WHEN (message_clicked_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END) AS clicked_count,
    count(
        CASE
            WHEN (message_replied_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END) AS replied_count,
    round((((count(
        CASE
            WHEN (message_opened_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END))::numeric / (count(DISTINCT user_id))::numeric) * (100)::numeric), 2) AS open_rate,
    round((((count(
        CASE
            WHEN (message_clicked_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END))::numeric / (count(DISTINCT user_id))::numeric) * (100)::numeric), 2) AS click_rate,
    round((((count(
        CASE
            WHEN (message_replied_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END))::numeric / (count(DISTINCT user_id))::numeric) * (100)::numeric), 2) AS reply_rate,
    max(updated_at) AS last_updated_at
   FROM public.broadcast_engagement be
  GROUP BY broadcast_id;


