--
-- Name: segment_performance; Type: VIEW; Schema: public; Owner: pnptvbot
--

CREATE VIEW public.segment_performance AS
 SELECT us.segment_id,
    us.name AS segment_name,
    count(DISTINCT sm.user_id) AS segment_size,
    count(DISTINCT be.broadcast_id) AS broadcasts_sent,
    round((((count(
        CASE
            WHEN (be.message_opened_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END))::numeric / (NULLIF(count(DISTINCT be.user_id), 0))::numeric) * (100)::numeric), 2) AS avg_open_rate,
    round((((count(
        CASE
            WHEN (be.message_clicked_at IS NOT NULL) THEN 1
            ELSE NULL::integer
        END))::numeric / (NULLIF(count(DISTINCT be.user_id), 0))::numeric) * (100)::numeric), 2) AS avg_click_rate
   FROM ((public.user_segments us
     LEFT JOIN public.segment_membership sm ON ((us.segment_id = us.segment_id)))
     LEFT JOIN public.broadcast_engagement be ON (((sm.user_id)::text = (be.user_id)::text)))
  WHERE (us.is_active = true)
  GROUP BY us.segment_id, us.name;


ALTER VIEW public.segment_performance OWNER TO pnptvbot;

